import React, { useState } from 'react';
import { styled } from '@mui/material/styles';
import Card from '@mui/material/Card';
import CardHeader from '@mui/material/CardHeader';
import CardMedia from '@mui/material/CardMedia';
import CardContent from '@mui/material/CardContent';
import CardActions from '@mui/material/CardActions';
import Collapse from '@mui/material/Collapse';
import Avatar from '@mui/material/Avatar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import { red } from '@mui/material/colors';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ShareIcon from '@mui/icons-material/Share';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import styled1 from 'styled-components';
import image1 from './images/Sanji_and_Zeff_Cooking.webp'
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import { Link } from 'react-router-dom';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogTitle from '@mui/material/DialogTitle';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import TextField from '@mui/material/TextField';
import DialogActions from '@mui/material/DialogActions';






const Centerpage = styled1.div`
  text-align: center;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const BigDiver = styled1.div`
  background-color: black;
  padding-bottom: 30%;
  color: white;
`;


const Titler = styled1.div`
  text-align: center;
  display: flex;
  flex-direction: column;
  align-items: center;

`;

const LoginSpace = styled1.div`
text-align: center;
display: flex;
flex-direction: column;
align-items: center;

`;


const ExpandMore = styled((props) => {
  const { expand, ...other } = props;
  return <IconButton {...other} />;
})(({ theme, expand }) => ({
  transform: !expand ? 'rotate(0deg)' : 'rotate(180deg)',
  marginLeft: 'auto',
  transition: theme.transitions.create('transform', {
    duration: theme.transitions.duration.shortest,
  }),
}));

function Home() {

  const [expanded, setExpanded] = React.useState(false);
  const [isDialogOpen, setIsDialogOpen] = useState(false);
  const [email, setEmail] = useState('');
  const [isLoginDialogOpen, setIsLoginDialogOpen] = useState(false);
  const [isAccountDialogOpen, setIsAccountDialogOpen] = useState(false);
  const [password, setPassword] = useState('');
  const [isValidationError, setIsValidationError] = useState(false);


  const handleExpandClick = () => {
    setExpanded(!expanded);
  };



  const handleCreateAccountClick = () => {
    setIsDialogOpen(true);
  };

  const handleDialogClose = () => {
    setIsDialogOpen(false);
  };

  const handleCreateAccount = () => {
    // Basic email and password validation
    if (email && password && password.length >= 6) {
      // Simulate account creation with a success message
      alert('Account created successfully!');
      setIsValidationError(false);
      setIsDialogOpen(false);
    } else {
      setIsValidationError(true);
    }
  };
  return (


<>
    <div className="App">
      <BigDiver>

<Titler>
<h1>
        <h1>CHIBI CANVAS</h1>

    </h1>
  </Titler>
<LoginSpace>
  <Button variant="contained" color="primary" href="/login">
            Log In
          </Button>
          <Button variant="contained" color="primary" onClick={handleCreateAccountClick}>
            Create Account
          </Button>
          </LoginSpace>
          <Dialog open={isDialogOpen} onClose={handleDialogClose}>
            <DialogTitle>Create Account</DialogTitle>
            <DialogContent>
              <DialogContentText>
                Please enter your email and password to create an account.
              </DialogContentText>
              <TextField
                autoFocus
                margin="dense"
                label="Email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                error={isValidationError}
                helperText={isValidationError && 'Please enter a valid email'}
                fullWidth
              />
              <TextField
                margin="dense"
                label="Password"
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                error={isValidationError && password.length < 6}
                helperText={isValidationError && password.length < 6 && 'Password must be at least 6 characters'}
                fullWidth
              />
            </DialogContent>
            <DialogActions>
              <Button onClick={handleDialogClose} color="primary">
                Cancel
              </Button>
              <Button onClick={handleCreateAccount} color="primary">
                Create
              </Button>
            </DialogActions>
          </Dialog>


  <Card sx={{ maxWidth: 345 }}>
      <CardHeader
        avatar={
          <Avatar sx={{ bgcolor: red[500] }} aria-label="recipe">
            R
          </Avatar>
        }
        action={
          <IconButton aria-label="settings">
            <MoreVertIcon />
          </IconButton>
        }
        title="Sanji's Paella"
        subheader="September 14, 2016"
      />
      <CardMedia
        component="img"
        height="194"
        image={image1}
        alt="Sanji's Paella"
      />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          This impressive paella is a perfect party dish and a fun meal to cook
          together with your guests. Add 1 cup of frozen peas along with the mussels,
          if you like.
        </Typography>
      </CardContent>
      <CardActions disableSpacing>
        <IconButton aria-label="add to favorites">
          <FavoriteIcon />
        </IconButton>
        <IconButton aria-label="share">
          <ShareIcon />
        </IconButton>
        <IconButton aria-label="Add to cart" href="/NewPage">
          <ShoppingCartIcon />
        </IconButton>

        <ExpandMore
          expand={expanded}
          onClick={handleExpandClick}
          aria-expanded={expanded}
          aria-label="show more"
        >
          <ExpandMoreIcon />
        </ExpandMore>
      </CardActions>
      <Collapse in={expanded} timeout="auto" unmountOnExit>
        <CardContent>
          <Typography paragraph>:</Typography>
          <Typography paragraph>
            Sanji/s tasy Paella
          </Typography>

        </CardContent>
      </Collapse>
    </Card>
    </BigDiver>
    </div>
    </>
  );
}

export default Home;
